package com.example.readbuddy.data

import android.content.Context
import androidx.room.Database
import androidx.room.Room
import androidx.room.RoomDatabase
import androidx.sqlite.db.SupportSQLiteDatabase
import com.example.readbuddy.model.User
import kotlinx.coroutines.CoroutineScope
import kotlinx.coroutines.launch


@Database(entities = [User::class], version = 1,  exportSchema = false)
abstract class UserDatabase : RoomDatabase() {

    abstract fun userDao(): UserDao

     companion object{
        @Volatile
        private var INSTANCE : UserDatabase? = null

        fun getDatabase(
            context: Context,
            scope: CoroutineScope
        ): UserDatabase {

            return INSTANCE ?: synchronized(this) {
                val instance = Room.databaseBuilder(
                    context.applicationContext,
                    UserDatabase::class.java,
                    "reading_list"
                )

                    .fallbackToDestructiveMigration()
                    .addCallback(WordDatabaseCallback(scope))
                    .build()
                INSTANCE = instance
                instance
            }
        }
    }


    private class WordDatabaseCallback(
        private val scope: CoroutineScope
    ) : RoomDatabase.Callback() {

        override fun onCreate(db: SupportSQLiteDatabase) {
            super.onCreate(db)
            INSTANCE?.let { database ->
                scope.launch {
                    var userDao = database.userDao()


                    userDao.addUser(User("Harry Potter and the Goblet of Fire","J.K. Rowling",650,"data:image/jpeg;base64,"))
                    userDao.addUser(User("The Lord of the Rings","J.R.R. Tolkien",580,"data:image/jpeg;base64,"))
                    userDao.addUser(User("The Da Vinci Code","Dan Brown",720,"data:image/jpeg;base64,"))
                    userDao.addUser(User("The Alchemist","Paulo Coelho",460,"data:image/jpeg;base64,"))
                    userDao.addUser(User("One Hundred Years of Solitude","Gabriel Garca Marquez",490,"data:image/jpeg;base64,"))
                    userDao.addUser(User("Charlottes Web","E.B. White",600,"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQmIHd8YqwOV-sLbe8TPbka4H38THh8vOj9fg&usqp=CAU"))
                    userDao.addUser(User("Black Beauty","Anna Sewell",640,"data:image/jpeg;base64,"))
                    userDao.addUser(User("Percy Jackson and the Lighting Thief ","Rick Riordan",550,"data:image/jpeg;base64,"))



                }
            }
        }
    }

}